import React from "react";

const Star = () => {
  let buttonText = "GOOD?";
  const HandleClick = () => {
    alert("works");
    if (buttonText === "GOOD?") {
      buttonText = "GOOD";
    } else {
      buttonText = "GOOD?";
    }
  };

  return <button onClick={HandleClick}>{buttonText}</button>;
};

export default Star;
